function triangleRadius(length, thickness) {
	// Calculate the middle points of the thickness edges
	// (0,0) is at the center of the top thickness edge
	let x = (0.5 * thickness) + (Math.cos(Math.PI/6)*length) - Math.cos(Math.PI/3)*0.5*thickness;
	let y = length + Math.sin(Math.PI/6)*length + Math.sin(Math.PI/3)*0.5*thickness;

	let a = Math.sqrt(x*x + y*y)

	let A = ((a*a)*Math.sqrt(3))/4;
	let R = (a * a * a)/(4*A);
	return R
}
